          {props.data ? props.data.items.map((item) => (
            <div>
            <div className="h4"> {item.header ? item.header : null} </div>
            <p> {item.text ? item.text : item} </p>
            </div>
          )) : "loading"
          }
        </div>
      </div>
    </div>
  )
}
